import React, {memo} from 'react';
import styled from 'styled-components';

const MenuContainer = styled.div`
    background-color: #f005;
`;

const Menu = memo(() => {
  return (
    <MenuContainer>
      <section className='menuWrap'>
      <a href='#' className='menuInner' style={{backgroundImage: `url(/img/menu_sec1.jpg)`}}></a>
      </section>
    </MenuContainer>
  );
});

export default Menu;
